import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
i
import EventList from './components/EventList';
import AddEventForm from './components/AddEventForm';
import EditEventForm from './components/EditEventForm';
// Assume DeleteEvent functionality is handled within EventList or EditEventForm

function App() {
  return (
    <BrowserRouter>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">List Events</Link>
            </li>
            <li>
              <Link to="/add-event">Add Event</Link>
            </li>
            {/* EditEvent link is not typically placed in the navbar since it requires an event ID to function properly */}
          </ul>
        </nav>
        <h1>Event Management System</h1>
        <Routes>
          <Route path="/" element={<EventList />} exact />
          <Route path="/add-event" element={<AddEventForm />} />
          <Route path="/edit-event/:eventId" element={<EditEventForm />} />
          {/* No dedicated route for delete as it might be an action within EventList or EditEventForm */}
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
